import {
  Card,
  CardActionArea,
  CardContent,
  CardMedia,
  Container,
  createStyles,
  Grid,
  makeStyles,
  Theme,
  Typography,
} from '@material-ui/core';
import dynamic from 'next/dynamic';
import { useRouter } from 'next/router';
import { Header } from '../components/Header';

const useStyles = makeStyles((theme: Theme) =>
  createStyles({
    root: {
      flexGrow: 1,
    },
    paper: {
      padding: theme.spacing(2),
      textAlign: 'center',
      color: theme.palette.text.secondary,
    },
    media: {
      height: 140,
    },
  }),
);

const DynamicWiki = dynamic(() => import('../components/Wikipedia').then((mod) => mod.Wikipedia));

const Page = () => {
  const router = useRouter();
  const slug = router.query.slug || [];
  const classes = useStyles();
  const point = slug[slug.length - 1];

  console.log(slug);
  return (
    <>
      <Header />
      <Container maxWidth="md" className={classes.root}>
        <Grid container>
          <Grid item xs={12}>
            <Card className={classes.root}>
              <CardActionArea>
                <CardMedia
                  className={classes.media}
                  image="/static/images/cards/contemplative-reptile.jpg"
                  title="Contemplative Reptile"
                />
                <CardContent>
                  <Typography gutterBottom variant="h5" component="h2">
                    {point}
                  </Typography>
                  <Typography variant="body2" color="textSecondary" component="p">
                    {slug.slice(0, slug.length - 1).join(', ')}
                  </Typography>
                </CardContent>
              </CardActionArea>
            </Card>
          </Grid>
          <Grid container>
            <Grid item xs={12}>
              <DynamicWiki />
            </Grid>
          </Grid>
        </Grid>
      </Container>
    </>
  );
};

Page.getInitialProps = async (ctx) => {
  // const res = await fetch(
  //   `https://api.mapbox.com/geocoding/v5/mapbox.places/${searchValue}.json?access_token=pk.eyJ1IjoiYXJ0ZGF3IiwiYSI6ImNrOGFzODg0MTA1M3MzZm1qMTAxNjJ6bjEifQ.CDaURiTGZYvrUNSspris3Q`,
  // );
  // const json = await res.json();
  return {};
};

export default Page;
